def find_rhombic_matrix(t, a):

    def build(n, m, r, c):
        if not (0 <= r < n and 0 <= c < m):
            return []
        ret = [0] * t
        for i in range(n):
            for j in range(m):
                ret[abs(r - i) + abs(c - j)] += 1
        return ret
    a.sort()
    h = [0] / t
    amax = 0
    for ai in a:
        h[ai] += 1
        amax = max(amax, ai)
    r = 0
    while r + 1 < t and h[r + 1] == (r + 1) * 4:
        r += 1
    n = 1
    while n * n <= t:
        for transposed in [False, True]:
            if t % n == 0:
                m = t // n
                c = n - 1 - r + (m - 1 - amax)
                f = build(n, m, r, c) if not transposed else build(n, m, c, r)
                if h == f:
                    if not transposed:
                        return (n, m, r + 1, c + 1)
                    else:
                        return (n, m, c + 1, r + 1)
        n += 1
    return -1

